column10:
Safety certification software version number.
The high 8 bits of the register store the high digits;
The lower 8 bits of the register store the lower digits.

Safety certification hardware version number 1st and 2nd.
The upper 8 bits of the register store the first bit of the serial number;
The lower 8 bits of the register store the second bit of the serial number.

The 3rd and 4th digits of the hardware version number of safety certification.
The upper 8 bits of the register store the third bit of the serial number;
The lower 8 bits of the register store the 4th bit of the serial number.

The 17th and 18th digits of the serial number.
The upper 8 bits of the register store the 17th bit of the serial number;
The lower 8 bits of the register store the 18th bit of the serial number.

The 19th and 20th digits of the serial number.
The high 8 bits of the register store the 19th bit of the serial number;
The lower 8 bits of the register store the 20th bit of the serial number.

Register for statistics power return date. This register indicate specifics year of the returned energy data. Year refers to the Nth most recent year relative to the inverter system time. N is the register value.
0: the current year of the system time;
1: 1 year before the system time;  19：19 year before the system time

Register for statistics power return date.  High byte: the time setting of the returned data.
0x01: Every day, the first 24 data in the return area are valid;
0x02: Every month, the first 31 data in the return area are valid;
0x03: Every year, the first 12 data in the return area are valid;
0x04: life cycle, the first 20 data in the return area are valid;
Other: invalid.
Low byte: the setting of the returned data.
0x01: photovoltaic  generation;
0x02: load consumption;
0x03: electricity Purchased from Grid ;
0x04: electricity sold to grid;
0x05: battery charging power;
0x06: battery discharging  power;
Other: invalid.

PID work start time (BCD code).
For example: the minimum value 0x0000 means 00:00;
The maximum value of 0x2359 means 23:59.

Timed charging and discharging-rule number;
The smaller the serial number, the higher the priority.
After successfully writing to this register, the timing charge and discharge parameters will be updated to the parameters corresponding to the written serial number.

Timing charge and discharge-enable control;
Bit0: charge enable
Bit1: Discharge enable

Time-of-use electricity price-rule number;
The smaller the serial number, the higher the priority.
After successfully writing to this register, the time-of-use electricity price parameter will be updated to the parameter corresponding to the written serial number.

Time-of-use price-rule enable;
0: disabled
1: enable

Passive mode-timeout control;
Default value: 0;
Set the passive mode communication timeout time. When the inverter does not receive any communication within the time set by this register, the inverter will force the timeout action.
In particular, writing 0 to this register will disable the timeout function.

Passive mode-timeout action;
0: Forced standby
1: Forced to restore to the energy storage mode before entering the passive mode

Manual mode expected grid power (Gdes);
A positive value indicates the power direction "from the grid to the system";
Negative values indicate the power direction "from system to grid".

The minimum charge and discharge power of the battery in Manual mode (Blo);
Positive value means charging;
Negative values indicate discharge.

The maximum charge and discharge power of the battery in Manual mode (Bup);
Positive value means charging;
Negative values indicate discharge.

Manual mode allows selling electric power (Gdzup);
A positive value indicates the power direction "from the grid to the system";
Negative values indicate the power direction "from system to grid".

Manual mode allows to buy electric power (Gdzlo);
A positive value indicates the power direction "from the grid to the system";
Negative values indicate the power direction "from system to grid".

Scheduler mode expected grid power (Gdes_Ante);
The parameters of the planned task are valid during the planned time period.
A positive value indicates the power direction "from the grid to the system";
Negative values indicate the power direction "from system to grid".

The minimum charge and discharge power of the battery in Scheduler mode (Blo_Ante);
The parameters of the planned task are valid during the planned time period.
A positive value indicates the power direction "from the grid to the system";
Negative values indicate the power direction "from system to grid".

The maximum charge and discharge power of the battery in Scheduler mode (Bup_Ante);
The parameters of the planned task are valid during the planned time period.
A positive value indicates the power direction "from the grid to the system";
Negative values indicate the power direction "from system to grid".

Scheduler mode allows to sell electric power (Gdzup_Ante);
The parameters of the planned task are valid during the planned time period.
A positive value indicates the power direction "from the grid to the system";
Negative values indicate the power direction "from system to grid".

Scheduler mode allows to buy electric power (Gdzlo_Ante);
The parameters of the planned task are valid during the planned time period.
A positive value indicates the power direction "from the grid to the system";
Negative values indicate the power direction "from system to grid".

Scheduler mode expected grid power (Gdes_Post);
Schedule task parameters, valid after the scheduled time period.
A positive value indicates the power direction "from the grid to the system";
Negative values indicate the power direction "from system to grid".

The minimum charge and discharge power of the battery in Scheduler mode (Blo_Post);
Schedule task parameters, valid after the scheduled time period.
A positive value indicates the power direction "from the grid to the system";
Negative values indicate the power direction "from system to grid".

The maximum charge and discharge power of the battery in Scheduler mode (Bup_Post);
Schedule task parameters, valid after the scheduled time period.
A positive value indicates the power direction "from the grid to the system";
Negative values indicate the power direction "from system to grid".

Scheduler mode allows to sell electric power (Gdzup_Post);
Schedule task parameters, valid after the scheduled time period.
A positive value indicates the power direction "from the grid to the system";
Negative values indicate the power direction "from system to grid".

Scheduler mode allows to buy electric power (Gdzlo_Post);
Schedule task parameters, valid after the scheduled time period.
A positive value indicates the power direction "from the grid to the system";
Negative values indicate the power direction "from system to grid".

The first and second place in the name of the safety-regulated country.
The upper 8 bits of the register store the first digit of the safety name;
The lower 8 bits of the register store the second bit of the safety name.

The third and fourth place in the name of the safety-regulated country.
The upper 8 bits of the register store the third digit of the safety name;
The lower 8 bits of the register store the 4th bit of the safety name.

The 5th and 6th place in the name of the safety-regulated country.
The upper 8 bits of the register store the 5th digit of the safety name;
The lower 8 bits of the register store the 6th bit of the safety name.

The 7th and 8th place in the name of the safety-regulated country.
The upper 8 bits of the register store the 7th bit of the safety name;
The lower 8 bits of the register store the 8th bit of the safety name.

The ninth and tenth place in the name of safety regulations.
The upper 8 bits of the register store the 9th bit of the safety name;
The lower 8 bits of the register store the 10th bit of the safety name.

Remote upgrade control register.
High byte. Writing 0xA5 is valid.
The low byte contains the chip combination that needs to be upgraded, and the explanation of each bit is as follows:
Bit0: communication board;
Bit1: control board 1 (main DSP);
Bit2: control board 2 (secondary DSP);
Bit3: Fuse

High byte. Writing 0xA5 is valid.
The low byte contains the chip combination that needs to be upgraded, and the explanation of each bit is as follows:
Bit0: communication board;
Bit1: control board 1 (main DSP);
Bit2: control board 2 (secondary DSP);
Bit3: Fuse

Current upgrade progress
The high byte indicates the current target chip to be upgraded:
0x00: Not in the upgrade state;
0x01: Main DSP upgrade;
0x02: Secondary DSP upgrade;
0x03: ARM upgrade;
0x04: FUSE upgrade;
The low byte indicates the current upgrade progress:
The progress range is 0-100%
